import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./pages/Login";

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/">
        {/* Home Component */}
        {/* <Route index element={<Home />} /> */}
        {/* Login Component */}
        <Route path="login" element={<Login />} />
      </Route>
    </Routes>
  </BrowserRouter>
  );
}

export default App;
